import React, { Component } from 'react';
import { motion } from "framer-motion";

let easing = [0.175, 0.85, 0.42, 0.96];

const imageVariants = {
  exit: { y: 150, opacity: 0, transition: { duration: 0.5, ease: easing } },
  enter: {
    y: 0,
    opacity: 1,
    transition: {
      duration: 0.5,
      ease: easing
    }
  }
};

const textVariants = {
  exit: { y: 100, opacity: 0, transition: { duration: 0.5, ease: easing } },
  enter: {
    y: 0,
    opacity: 1,
    transition: { delay: 0.1, duration: 0.5, ease: easing }
  }
};

const backVariants = {
  exit: {
    x: 100,
    opacity: 0,
    transition: {
      duration: 0.5,
      ease: easing
    }
  },
  enter: {
    x: 0,
    opacity: 1,
    transition: {
      delay: 0.5,
      duration: 0.5,
      ease: easing
    }
  }
};

class Home extends Component {
  render(){
    return(
      <div className="bg-dark vh-100" Style="margin-top:-56px;">
        <div className="position-absolute pl-lg-5 container text-white" Style = "top: calc(50vh - 56px);" id="topmessage">

          <motion.div initial="exit" animate="enter" exit="exit">
            <div className = "mb-5">
              <motion.div variants={textVariants}>
                <h1>Yu Ohno's Portfolio</h1>
              </motion.div>
              <motion.div variants={textVariants}>
                <h2>Move Emotion</h2>
              </motion.div>
            </div>
            <motion.div variants={textVariants}>
              <p>Hi, I'm Yu Ohno from Japan and post-support engineer (mainly), calligrapher, artist and designer. </p>
            </motion.div>


          </motion.div>
        </div>
      </div>
    )
  }
}
export default Home;
